template <size_t order>
const arma::mat& interaction_matrix( geometry::cellid delta );

template <>
const arma::mat& interaction_matrix<3>( geometry::cellid delta )
{
    if ( -1 > delta.i || delta.i > 1 ||
         -1 > delta.j || delta.j > 1 ||
         -1 > delta.k || delta.k > 1 )
    {
        throw std::out_of_range { "interaction_matrix<3>: id out of bounds." };
    }

    delta.i += 1; delta.j += 1; delta.k += 1;
    size_t idx = 3*3*delta.k + 3*delta.j + delta.i;
    return A[idx];
}

